import { A } from '@ember/array';
import Controller from '@ember/controller';
import { get } from '@ember/object';

const imgData = 'data:image/jpeg;base64,';

export default Controller.extend({
  author: 'Matt-Jensen',
  opts: {orientation: 'landscape'},
  steps: A([
    {setFontSize: 40},
    {text: [35, 25, 'Paranyan loves jsPDF']},
    {addImage: [imgData, 'JPEG', 15, 40, 180, 160]}
  ]),

  actions: {
    addPdfAuthor(author = '') {
      get(this, 'steps').pushObjects([
        {setFontSize: 16},
        {text: [35, 215, `With boundless affection by: ${author}`]}
      ]);
    }
  }
});
